    if (this.timeEnd < 0)
        this.timeEnd = 0;
    if (this.timeEnd) {
        this.addChild(this.field);
        if (this.timer)
            clearInterval(this.timer);
        this.timer = setInterval(this.timerHandler.bind(this), 500)
    } else {
        this.removeIfExist(this.field);
        if (this.timer)
            clearInterval(this.timer)
    }
